import React from 'react'
import {Row, Col } from 'react-bootstrap'
import {Cont1} from './ComponentHome/Cont1'
import {Cont2} from './ComponentHome/Cont2'
import {Cont3} from './ComponentHome/Cont3'

export const Home = ({params}) => {

    return (
        <Row className="homeContent g-0">
            {
                (params.sizeScreen === "isBigDesktop" || params.sizeScreen === "isBigDeskisDesktoptop")
                && <div>
                        <Cont1/>
                        <Col md={4}>
                            <Cont2/>
                            <Cont3/>
                        </Col>
                    </div>
            }
        </Row>
    )
}


